import React, {Component} from 'react';

import './component.css';

class ShadowsPicture extends Component {
    componentDidMount() {

        /* values from user interface */
        let tWidth;
        let nbParticles;        // number of particles
        let lifeTime;           // average lifetime of particles
        let glVel;              // global velocity;
        let dirChannel, dirReverse;
        let hueChannel, hueReverse;
        let lineWidth;
        /* end of values from user interface */

        let goodImage = false;

        let particles;   // array of particles
        let dimx, dimy; // dimensions of target image
        let requestID;   // ID provided by window.requestAnimationFrame();
        let destCtx;
        let srcData;
        let fnDir, fnHue; // functions to use according to user's choice

        /* shortcuts for Math */

        const mrandom = Math.random; // see above alternative function for reproductible results
        const mfloor = Math.floor;
        const mmin = Math.min;
        const mmax = Math.max;

        const m2PI = Math.PI * 2;
        const msin = Math.sin;
        const mcos = Math.cos;

        const coeffDir = m2PI / 256;

        //-----------------------------------------------------------------------------
        // miscellaneous functions
        //-----------------------------------------------------------------------------

        function alea(min, max) {
        // random number [min..max[ . If no max is provided, [0..min[

            if (typeof max == 'undefined') return min * mrandom();
            return min + (max - min) * mrandom();
        }

        // - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -

        function intAlea(min, max) {
        // random integer number [min..max[ . If no max is provided, [0..min[

            if (typeof max == 'undefined') {
                max = min;
                min = 0;
            }
            return mfloor(min + (max - min) * mrandom());
        } // intAlea

        // - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -

        /**
         * Converts an RGB color value to HSL. Conversion formula
         * adapted from http://en.wikipedia.org/wiki/HSL_color_space.
         * Assumes r, g, and b are contained in the set [0, 255] and
         * returns h, s, and l in the set [0, 1].
         *
         * @param   {number}  r       The red color value
         * @param   {number}  g       The green color value
         * @param   {number}  b       The blue color value
         * @return  {Array}           The HSL representation
         */
        function rgbToHsl(r, g, b) { // this function copied from somewhere on Stack Overflow

            r /= 255;
            g /= 255;
            b /= 255;
            var max = mmax(r, g, b), min = mmin(r, g, b);
            var h, s, l = (max + min) / 2;

            if (max === min) {
                h = s = 0; // achromatic
            } else {
                var d = max - min;
                s = l > 0.5 ? d / (2 - max - min) : d / (max + min);
                switch (max) {
                    case r:
                        h = (g - b) / d + (g < b ? 6 : 0);
                        break;
                    case g:
                        h = (b - r) / d + 2;
                        break;
                    case b:
                        h = (r - g) / d + 4;
                        break;
                    default:
                        h = 1;
                        break;
                }
                h /= 6;
            }

            return [h, s, l];
        } // function rgbToHsl

        //------------------------------------------------------------------------
        function createParticle() {

            return {
                x: alea(0, dimx),
                y: alea(0, dimy),
                sat: `${intAlea(50, 101)}%`,
                light: `${intAlea(30, 80)}%`,
                TTL: alea(lifeTime * 0.8, lifeTime * 1.2) // time to live
            }
        } // createParticle
        // - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -
        function createParticles() {
            particles = [];                  // create empty array;
            for (let k = 0; k < nbParticles; ++k) {
                particles.push(createParticle());
            } // for k
            particles.forEach(part => {
                part.TTL = intAlea(lifeTime); // to avoid too many deaths / births in firts generations
            });
        } // createParticles

        //------------------------------------------------------------------------
        // functions for direction
        // input : r,g,b and h,s,l : colors of pixel at particle position
        //   + boolean inverted
        //  rgb in range 0..255
        //  h, s, l in range 0..1
        // returns number between 0 and  2 * PI
        //
        function dirRed(r, g, b, h, s, l, inverted) { // use red for direction
            let dir = r * coeffDir;
            return inverted ? -dir : dir;
        }

        function dirGreen(r, g, b, h, s, l, inverted) { // use green for direction
            let dir = g * coeffDir;
            return inverted ? -dir : dir;
        }

        function dirBlue(r, g, b, h, s, l, inverted) { // use blue for direction
            let dir = b * coeffDir;
            return inverted ? -dir : dir;
        }

        function dirHue(r, g, b, h, s, l, inverted) { // use hue for direction
            let dir = h * m2PI;
            return inverted ? -dir : dir;
        }

        function dirSaturation(r, g, b, h, s, l, inverted) { // use saturation for direction
            let dir = s * m2PI;
            return inverted ? -dir : dir;
        }

        function dirLightness(r, g, b, h, s, l, inverted) { // use lightness for direction
            let dir = l * m2PI;
            return inverted ? -dir : dir;
        }

        // functions for hue
        // same input as functions for velocity
        // returns number 0..360

        function hueRed(r, g, b, h, s, l, inverted) { // use red for hue
            let hue = r / 255 * 360;
            return inverted ? 360 - hue : hue;
        }

        function hueGreen(r, g, b, h, s, l, inverted) { // use green for hue
            let hue = g / 255 * 360;
            return inverted ? 360 - hue : hue;
        }

        function hueBlue(r, g, b, h, s, l, inverted) { // use blue for hue
            let hue = b / 255 * 360;
            return inverted ? 360 - hue : hue;
        }

        function hueHue(r, g, b, h, s, l, inverted) { // use hue for hue !
            let hue = h * 360;
            return inverted ? 360 - hue : hue;
        }

        function hueSaturation(r, g, b, h, s, l, inverted) { // use saturation for hue
            let hue = s * 360;
            return inverted ? 360 - hue : hue;
        }

        function hueLightness(r, g, b, h, s, l, inverted) { // use Lightness for hue
            let hue = l * 360;
            return inverted ? 360 - hue : hue;
        }

        //------------------------------------------------------------------------

        function move() {

            let part, prev, dir, r, g, b, h, s, l;
            let intx, inty; // position of particle in integer numbers

            for (let k = 0; k < nbParticles; ++k) {
                part = particles[k];
                // death and re-birth
                if (part.TTL <= 0) {
                    part = createParticle();
                    particles[k] = part;
                }
                intx = mfloor(part.x);
                inty = mfloor(part.y);
                if (intx < 0 || intx >= dimx || inty < 0 || inty >= dimy) {
                    part = createParticle();
                    particles[k] = part;
                    intx = mfloor(part.x);
                    inty = mfloor(part.y);
                }
                // get current pixel in rgb and hsl forms
                let offs = (inty * dimx + intx) * 4; // offset in pixel buffer (srcData)

                r = srcData[offs++];
                g = srcData[offs++];
                b = srcData[offs];
                [h, s, l] = rgbToHsl(r, g, b);

                dir = fnDir(r, g, b, h, s, l, dirReverse);

                let hue = fnHue(r, g, b, h, s, l, hueReverse);

                prev = {x: part.x, y: part.y}; // position before this move

                part.x += mcos(dir) * glVel;
                part.y += msin(dir) * glVel;

                --part.TTL; // decrease time to live
                // draw it

                destCtx.beginPath();
                destCtx.moveTo(prev.x, prev.y);
                destCtx.lineTo(part.x, part.y);
                destCtx.strokeStyle = `hsl(${hue},${part.sat},${part.light})`;
                destCtx.stroke();

            } // for k (loop on particles)
        } // move

        //--------------------------------------------------------------------
        const createImage = () => {

            if (!goodImage) return; // no picture to work on

            /* read user's choice and choose functions accordingly */
            readUI();
            fnDir = [dirRed, dirGreen, dirBlue, dirHue, dirSaturation, dirLightness][dirChannel];
            fnHue = [hueRed, hueGreen, hueBlue, hueHue, hueSaturation, hueLightness][hueChannel];

            let srcCtx = this.refs.referenceCanvas.getContext('2d');

            destCtx = this.refs.destCanvas.getContext('2d');

            dimx = tWidth;
            dimy = tWidth * img.height / img.width;

            srcCtx.drawImage(img, 0, 0, dimx, dimy);

            destCtx.fillStyle = '#343a40'; //  for thos who save image
            destCtx.fillRect(0, 0, dimx, dimy);

            destCtx.lineWidth = lineWidth;
            destCtx.imageSmoothingEnabled = false;

            createParticles();

            srcData = srcCtx.getImageData(0, 0, dimx, dimy).data;
            if (typeof requestID == 'number') window.cancelAnimationFrame(requestID);


            (function animate() {
                move();
                requestID = window.requestAnimationFrame(animate);
            })();


        } // function createImage

        //--------------------------------------------------------------------

        function loaded() {

            goodImage = true;
            createImage();
        } // loaded

        // - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -

        function loadImage(number) {
            goodImage = false;

            img.src = ["data:image/jpeg;base64,"
            ][number - 1];
        } // loadImage

        //--------------------------------------------------------------------

        function readUI() {
        // read user interface

            let ctrl, x;

            // target width
            ctrl = {value: window.innerWidth > 600 ? 600 : window.innerWidth};
            x = parseInt(ctrl.value, 10);
            if (isNaN(x)) {
                x = tWidth
            }
            if (x < 200) x = 200;
            if (x > 2000) x = 2000;
            ctrl.value = tWidth = x;

            // global velocity
            ctrl = {value: 0.2};
            x = parseFloat(ctrl.value, 10);
            if (isNaN(x)) {
                x = glVel
            }
            if (x < 0.3) x = 0.3;
            if (x > 10) x = 10;
            ctrl.value = glVel = x;

            // line Width
            ctrl = {value: 1};
            x = parseFloat(ctrl.value, 10);
            if (isNaN(x)) {
                x = lineWidth
            }
            if (x < 0.1) x = 0.1;
            if (x > 10) x = 10;
            ctrl.value = lineWidth = x;

            // dirChannel
            ctrl = {value: 3};
            dirChannel = parseInt(ctrl.value, 10); // always good value - I hope so
            dirReverse = false;

            // hueChannel
            ctrl = {value: 2}
            hueChannel = parseInt(ctrl.value, 10); // always good value - I hope so
            hueReverse = false;

            // number of particles
            ctrl = {value: 5000};
            x = parseInt(ctrl.value, 10);
            if (isNaN(x)) {
                x = nbParticles
            }
            if (x < 20) x = 20;
            if (x > 10000) x = 10000;
            ctrl.value = nbParticles = x;

            // lifeTime
            ctrl = {value: 400};
            x = parseInt(ctrl.value, 10);
            if (isNaN(x)) {
                x = lifeTime
            }
            if (x < 100) x = 100;
            if (x > 2000) x = 2000;
            ctrl.value = lifeTime = x;

        } // readUI
        //--------------------------------------------------------------------

        // - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -
        function displayError(message) {
            let msg = document.getElementById('msg');
            msg.innerHTML = message;
            setTimeout(function () {
                msg.innerHTML = '&nbsp;'
            }, 2000);
        } // displayError

        //--------------------------------------------------------------------

        // beginning of execution

        let img = new Image();
        img.crossOrigin = "anonymous";
        img.addEventListener('load', loaded);
        img.addEventListener('error', function () {
            displayError("unable to load picture");
            goodImage = false;
        });

        createImage();
        loadImage(1);
    }

    componentWillUnmount() {
        // window.removeEventListener('resize', startOver);
    }

    render() {
        const width = window.innerWidth > 600 ? 600 : window.innerWidth;
        const height = width * 4 / 3;

        return (
            <div className="canvas-element-shadow">
                <canvas ref='destCanvas' width={width} height={height} className="dest-canvas"/>
                <div className="ref-canvas">
                    <canvas width={width}  height={height} id='referenceCanvas' ref='referenceCanvas'/>
                </div>
            </div>
        )
    }
}

export default ShadowsPicture;